window.bookSummaryJSON = "<p>Magnus and Kaitlyn are trying to heal. To live. To love.</p> <p>But they're entangled in futures and pasts that threaten to pull them apart.</p> <p>\"You get scared?\"</p> <p>\"Aye, sometimes. Mostly for ye. I am scared I winna be able tae keep ye safe.\"</p> <p>There are vessels that must be secured. A castle with walls that have been breached. A baby about to be born, and a future that demands to be reckoned with.</p> <p>But through it all Magnus loves Kaitlyn and maybe that is enough...</p> <p>His voice rumbled up from his heart. “I want ye tae ken, mo reul-iuil, that I love ye beyond what I have the words tae say. I canna describe the depths of it, but I need ye tae ken that I will live my life tryin’ tae speak tae ye on it.”</p> <p>I pressed against him. “Then I will spend my whole life listening.”</p> <p>“Aye, I thank ye for it.”</p> <p>Now including the short story 4.5 <i>A Missing Entanglement</i>.</p> <p>A contemporary romance with a dash of history and a bit of SciFi, <i>Entangled with You</i> is the fifth book in the Kaitlyn and the Highlander series.</p> <p>If you love mysterious heroes with desperate hearts and romantic thoughts, heroines with courage who are also very ordinary disasters, and love stories that encompass all time, then you’ll love this suspenseful series. Join the adventure, buy audiobook one today.</p>"; 
